    <div className='row'>
        <div className="hero">

            <img className='hero' src={heroimg} />
            <Icon/>
            <div className="text-block">
                <h4>Our Newly Introduced Course</h4>
            </div>
        </div>
    </div>
</div>

</>
    );
};
export default Hero;
